import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";

const AppLayout = ({ children }) => {
  return (
    <>
      <div>
        <div>
          <Link href="/">
            <a>홈페이지</a>
          </Link>
          <Link href="/images">
            <a>이미지</a>
          </Link>
        </div>
        {children}
      </div>
    </>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
